import React from "react";
import { Link } from "react-router-dom";
import Cookies from "js-cookie";
import "./index.css";
function SideBar() {

  const logout = () => {
      console.log('logout working')
      Cookies.remove("role");
      Cookies.remove("")

  }

  return (
    <>
      <div className="sidebar-container">
        <div className="admin-container">
          <h1 className="heading-admin">Admin</h1>
        </div>

        <Link to="/" className="link">
          <p className="sidebar-para-list">Dashboard</p>
        </Link>
        <Link to="/executies" className="link">
          <p className="sidebar-para-list">Execuites</p>
        </Link>

        <div className="logout-container">
          <button className="sidebar-button" onClick={logout}>logout</button>
        </div>
      </div>
    </>
  );
}
export default SideBar;
